import React, { Component } from "react";
import DarkContext from "./../../context/darkMode";

export default class SearchBar extends Component {
  render() {
    return (
      <DarkContext.Consumer>
        {(darkContext) => (
          <form className="search-bar">
            <input type="text" />
            <input type="submit" />
          </form>
        )}
      </DarkContext.Consumer>
    );
  }
}
